  \"Nanomaterials-Based Water and Moisture Impermeable Barrier for Food Packaging
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
